function Header(props) {

    const styles = {
        navBar: {
            display: 'flex',
            justifyContent: 'space-between',
            alignItems: 'center',
            padding: '9px 3%'
        },
        links: {
            textDecoration: 'none'
        }
    }

    return (
        <nav style={styles.navBar}>
            <ul>
                <a href='#home'>Home</a>
                <a href='#about me'>About Me</a>
                <a href='#projects'>Projects</a>
                <a href='#contact'>Contact</a>
            </ul>
            <h3 href='#home'>{props.title}</h3>
        </nav>
    )
  }

  export default Header;
